import React from "react";
import Nav from "./components/Nav";
import Hero from "./components/Hero";
import Card from "./components/Card";
import Image from "./images/image 12.png"
import Star from "./images/Star 1.png"
import wedding from "./images/wedding-photography 1.png"
import mountain from "./images/mountain-bike 1.png"
import cardData from "./components/cardData";

export default function App(){
    const Card = cardData.map((card) => {
        return <Card img={card.img}
                     star={card}/>
    })
    return(
        <div>
            <Nav />
            <Hero />
            <Card 
                img = {Image}
                star ={Star}
                rating ="5.0"
                people ="(6)"
                country ="USA"
                topic ="Life lessons with Katie Zaferes"
                amount ="From $136"
            />
             <Card 
                img = {wedding}
                star ={Star}
                rating ="5.0"
                people ="(30)"
                country ="UK"
                topic ="Learn wedding photography"
                amount ="From $125"
            />
             <Card 
                img = {mountain}
                star ={Star}
                rating ="4.8"
                people ="(2)"
                country ="NIGERIA"
                topic ="Group Mountain Biking"
                amount ="From $50"
            />
        </div>
    )
}
